import React from 'react';
import headerLogo from '../images/header-logo.svg';

function Header() {
  return (
    <header className="header">
      <img src={headerLogo} alt="Логотип Место" className="logo" />
      <button
        type="submit"
        className="header__button-authentication header__login"
        aria-label="Перейти"
        //onClick={signIn}
      >
        <Link to="/sign-in">
          <h3 className="header__button-title">Войти</h3>
        </Link>
      </button>
      <button
        type="submit"
        className="header__button-authentication header__logup"
        aria-label="Перейти"
        //onClick={signUp}
      >
        <Link to="/sign-up">
          <h3 className="header__button-title">Регистрация</h3>
        </Link>
      </button>
    </header>
  );
}

export default Header;
